import styled from 'styled-components'
const bluee = '#61dafb'
const purplee = '#6c63ff'

const Area = styled.div`
  h1 {
    font-family: "Roboto Thin";
    font-size: 56px;
    text-shadow: 2.5px 2.5px 2px ${bluee};
  }

`
export default Area;
